import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      pokeList:[]
    }
    this.getChamp = this.getChamp.bind(this);
  }

  componentDidMount(){
    this.getChamp()
  }

  getChamp() {
    fetch('https://pokeapi.co/api/v2/type/10/')
    .then(response => response.json())
    .then(poke => { poke.pokemon.map(poke => ({
      name: `${poke.pokemon.name}`
    }))
  })
  .catch(error => console.log('Champion not found!', error))
}

  render (){
    const pokeList = this.state;
    return(
      <div className="App">
{pokeList.map(poke => {
  const name = poke;
  return <p>{name}</p>
})}
    </div>)
  };
}

export default App;
